import React from 'react';
import './Sidebar.css';
import {Link} from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className='side-bar'>
      <ul>
        <li><i className="fa-solid fa-house fa-fw"></i><Link to='/admin-dashboard'>Dashboard</Link></li>
        <li><i className="fa-solid fa-calendar-days fa-fw"></i><Link to='/all-appointments'>Appointments</Link></li>
        <li><i className="fa-solid fa-plus fa-fw"></i><Link to='/add-doctor'>Add Doctor</Link></li>
        <li><i class="fa-solid fa-users fa-fw"></i><Link to='/doctor-list'>Doctors List</Link></li>
      </ul>
    </div>
  )
}

export default Sidebar
